import { useCallback, useEffect, useState, useRef } from "react";
import { useNavigate } from "react-router-dom";
import { useSpring, animated } from "@react-spring/web";
import "./Results.css";

const Results = () => {
  const navigate = useNavigate();
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [isTyping, setIsTyping] = useState(false);
  const [typedText, setTypedText] = useState("");
  const footerRef = useRef(null);

  const fullText = "ADDHDR: integrating gamification and dynamic questionnaires to simplify the diagnosis process";

  // Consolidated navigation handlers
  const navigationHandlers = {
    contact: useCallback(() => navigate("/contact"), [navigate]),
    allAssessments: useCallback(() => navigate("/all-assessments"), [navigate]),
    aboutUs: useCallback(() => navigate("/about-us"), [navigate]),
    adhdResources: useCallback(() => navigate("/adhd-resources"), [navigate]),
    yourResults: useCallback(() => navigate("/your-results"), [navigate]),
    home: useCallback(() => navigate("/"), [navigate])
  };

  const handleLogout = useCallback(() => {
    setIsLoggedIn(false);
    // Add your logout logic here
  }, []);

  const openInNewTab = useCallback((url) => {
    window.open(url, '_blank', 'noopener,noreferrer');
  }, []);

  // Animation for fading in content
  const fadeProps = useSpring({
    opacity: 1,
    transform: "translateY(0px)",
    from: { opacity: 0, transform: "translateY(50px)" },
    config: { duration: 800 },
  });

  // Typing animation observer
  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          setIsTyping(true);
        }
      },
      { threshold: 0.5 }
    );

    if (footerRef.current) {
      observer.observe(footerRef.current);
    }

    return () => observer.disconnect();
  }, []);

  // Typing animation effect
  useEffect(() => {
    if (!isTyping) return;

    let index = 0;
    setTypedText("");

    const typingInterval = setInterval(() => {
      if (index < fullText.length) {
        setTypedText(prev => prev + fullText.charAt(index));
        index++;
      } else {
        clearInterval(typingInterval);
      }
    }, 100);

    return () => clearInterval(typingInterval);
  }, [isTyping, fullText]);

  // Navigation item component
  const NavItem = ({ onClick, path, label }) => (
    <div
      className={`nav-item ${window.location.pathname === path ? "nav-item-active" : ""}`}
      onClick={onClick}
    >
      {label}
    </div>
  );

  // Content section component
  const SectionCard = ({ title, children }) => (
    <div className="section-card">
      <h2 className="section-title">{title}</h2>
      <p className="section-text">{children}</p>
    </div>
  );

  return (
    <div className="contact-us-page">
      <div className="home">
        {/* Header Section */}
        <div className="header">
          <div className="adhdr-container">
            <NavItem onClick={navigationHandlers.home} path="/" label="ADHDR" />
          </div>
          <div className="about-container">
            <NavItem onClick={navigationHandlers.aboutUs} path="/about-us" label="About Us" />
          </div>
          <div className="results-container">
            <NavItem onClick={navigationHandlers.yourResults} path="/your-results" label="Your Results" />
          </div>
          <div className="resources-container">
            <NavItem onClick={navigationHandlers.adhdResources} path="/adhd-resources" label="ADHD Resources" />
          </div>
          <div className="contact-container">
            <NavItem onClick={navigationHandlers.contact} path="/contact" label="Contact Us" />
          </div>
          <div className="contact-container">
            {isLoggedIn ? (
              <NavItem onClick={handleLogout} label="Log Out" />
            ) : (
              <NavItem onClick={navigationHandlers.home} path="/login" label="Login or Sign Up" />
            )}
          </div>
        </div>

        {/* Main Content Section */}
        <animated.div style={fadeProps} className="content-wrapper">
          <div className="about-title">
            <h1>ADHD_AI Assist</h1>
            <p className="tagline">
              Exploring innovative solutions for managing ADHD with technology!
            </p>
          </div>

          <div className="content-sections">
            <SectionCard title="What is ADHD?">
              Attention-Deficit/Hyperactivity Disorder (ADHD) is a neurodevelopmental
              disorder that affects focus, behavior, and decision-making.
            </SectionCard>

            <SectionCard title="Our Mission">
              Traditional diagnostic methods often struggle to fully understand the complex and changing nature of ADHD symptoms, especially in younger and neurodiverse individuals. We aim to enhance ADHD diagnosis through gamification and adaptive assessment.
            </SectionCard>

            <SectionCard title="How It Works">
              Play a 5-10 minute game and get your results.<br />It's that easy!
            </SectionCard>
          </div>

          <div className="call-to-action">
            <button
              className="cta-button hover-effect"
              onClick={() => openInNewTab("https://www.jneurolab.org/")}
            >
              Learn More About Our Lab
            </button>
            <button 
              className="cta-button hover-effect" 
              onClick={navigationHandlers.contact}
            >
              Contact Us
            </button>
          </div>
        </animated.div>

        {/* Footer Section */}
        <div className="navigation-footer1" ref={footerRef}>
          <div className="adhdr3">
            <p className="adhdr4">
              {typedText}
              {typedText.length < fullText.length && <span className="ellipsis">...</span>}
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Results;
